import { Button } from '@material-ui/core'
import React from 'react'
import { Data } from './Data'
import { Container, Wrapper, Content } from './style'
function Card() {
    return (
        <Container>
            {Data.map((data) => (
                <Wrapper
                // style={{
                //     backgroundImage: `url('${data.imgUrl})'`,
                //     backgroundSize: 'cover',
                // }}
                >
                    <Content>
                        <h1>{data.title}</h1>
                        <Button>Shop Now</Button>
                    </Content>
                </Wrapper>
            ))}
        </Container>
    )
}

export default Card
